import './Login.css';
import {Link} from 'react-router-dom';
function Login() {
  return (
    <>
    <main>  
        <div className="left">
        <Link to="/"><p className="logo">lulu school</p></Link>
            <div className="form">
                <h3>Аккаунтқа кіру</h3>

                <input type="email" id="email" name="email" placeholder="Электрондық пошта: "/>
                
                <input type="password" id="password" name="pass" placeholder="Құпия сөз:"/>
                <input type="checkbox" id="checkbox" name="pass" placeholder="Құпия сөз:"/>
                <label className="form-check-label">Remember me</label>
                <br></br>
                <button>КІРУ</button>
                <p id="butW">Аккаунтыңыз жоқ па? <Link to="/signup">Тіркелу</Link></p>
            </div>
        </div>
        <div className="right">
        </div>
    </main>

    </>
  );
}

export default Login;
